import React from 'react';
import './Modal.css';


const Modal = (props) => {
    return (
        <div className='modal_background'>
            <div className='modal_window w-50 mx-auto mt-5'>
                <div className='modal_header'>
                    <h1>Header</h1>
                </div>
                <div className='modal_body'>
                    <h3>Body</h3>
                </div>
                <div className='modal_footer'>
                    <h6>Footer</h6>
                </div>
            </div>
        </div>
    )
}

export default Modal;
